--Creazione dummy market con 8k di spazio occupato

DROP SCHEMA IF EXISTS "dummysocialmarket" cascade;
CREATE SCHEMA IF NOT EXISTS  "dummysocialmarket";
SET search_path to "dummysocialmarket";
SET datestyle to "MDY";

-- dallo schema creato per socialmarket in dummymarket si aggiunge una variabile
--dummy di tipo text per raggiungere più velocemente l’occupazione di spazio disco

CREATE TABLE Clienti(
	Cod_Fisc VARCHAR(20) NOT NULL,
	Cod_Fam VARCHAR(5) NOT NULL,
	Ente VARCHAR (30) NOT NULL,
	Data_inizio DATE NOT NULL,
	Abilitato BOOLEAN NOT NULL DEFAULT FALSE,
	Reddito DECIMAL (5),
	Fasce VARCHAR(20) NOT NULL,
  	dummy TEXT
);


CREATE TABLE Volontari(
	Id_Vol VARCHAR(20) NOT NULL,
	Veicolo VARCHAR(30) NOT NULL,
	Disponibilità VARCHAR(60) NOT NULL,
	Trasporto BOOLEAN NOT NULL DEFAULT FALSE,
	Appuntamento BOOLEAN NOT NULL DEFAULT FALSE,
	Scarico BOOLEAN NOT NULL DEFAULT FALSE,
	Associazione VARCHAR(30),
  	dummy TEXT
);


CREATE TABLE Appuntamenti(
	Cod_App VARCHAR(8) NOT NULL,
	Data_ora TIMESTAMP NOT NULL,
	Id_Cl VARCHAR(20) NOT NULL,
	Id_Vol VARCHAR(20) NOT NULL,
  	dummy TEXT
);


CREATE TABLE ProdottiUscita(
	Cod_Ap VARCHAR(8) NOT NULL,
	Cod_Prod VARCHAR(30) NOT NULL,
	Data_Scad DATE NOT NULL,
	Quantità DECIMAL(4) NOT NULL,
  	dummy TEXT
);

